import React from 'react' ;
import ReactDOM from 'react-dom' ;

function Para(){
    return (
        <>
        <p> This is my world</p>
        <ol>
        <li> Alok </li>
        <li> Rahul </li>
        <li> Rakesh </li>
        <li> Javed </li>
        </ol>
        </>
        
    )
}

export default Para ;
